import logo from './logo.svg';
import './App.css';
import Loading from './loading/loading';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
  Routes
} from 'react-router-dom';

function App() {
  return (
    <Router>
    <Routes>
    <Route path='/' element={<Loading />} exact />
    <Route path="/event" element={<h2>Hey</h2>} />
    </Routes>
  </Router>
  );
}

export default App;
